import React from 'react';

const ClinicCard = ({ clinic, onEdit, onDelete }) => {
  return (
    <div className="doctor-card">
      <img src={clinic.clinicPicture} alt={clinic.name} />
      <div className="doctor-info">
        <h2>{clinic.name}</h2>
        <p>Address: {clinic.address}</p>
        <p>Doctor: {clinic.doctor}</p>
        <button className="clinic-button" onClick={() => onEdit(clinic)}>Edit</button>
        <button className="clinic-button" onClick={() => onDelete(clinic)}>Delete</button>
      </div>
    </div>
  );
};

export default ClinicCard;
